import React from 'react';
// import './Slider.css'; // Create a CSS file for styling if needed


const Feature = ( content ) => {
  return (

      // {console.log(content)}
      <div className="col-9 col-4-medium">
          <section className="box feature">
            {/* Add inline styles to the image tag */}


            <div className="content">
            <a href="#" className="image featured">
              <img src={content.content.pic} alt="" className="featureImg" style={{ width: '120%', height: '200px', objectFit: 'cover'}} />
            </a>

              <header>
                <h2> {content.content.address} </h2>
                <p>{content.content.price}</p>
              </header>
              <p>{content.content.description}</p>
            </div>

          </section>
      </div>
  );
};

export default Feature;
